import React from 'react'

const book = ({All, randomPick}) => {
  return (
    <div className='bookInfo'>
      <img src={'../books/베스트셀러/1. 종합/종합1.jpg'}/>
      <span>{All.제목[randomPick]}</span>
      <span>{All.저자[randomPick]} 지음 | {All.가격[randomPick]}</span>
    </div>
  )
}

export default book
